Всем привет!
Ищу Data Scientist, Data Engineer и Data Steward в Леруа Мерлен на проекты по HR Big data.
*Задачи:*
- описательная аналитика для выявления точек роста бизнеса за счет изменения политик и процедур по управлению персоналом;
- predictive analytics для управления численностью и графиками работы в магазинах;
- решение задач гео-аналитики для оценки потенциала открытия новых магазинов;
- разработка рекомендательных систем в различных областях управления персоналом;
- разработка алгоритмов, повышающих эффективность процессов найма, обучения и развития сотрудников;
- разработка моделей управления производительностью персонала.
Ищу специалистов, которые составят команду по выстраиванию процесса от подготовки данных до передачи модели "в промышленную эксплуатацию".
*Стек технологий*: TensorfFow, XGBoost, scikit-learn, pandas, Numpy, hive, spark; Nifi, Spark, Kafka, Greenplum, Gitlab. HR системы, с данными из которых предстоит работать: Босс Кадровик, SAP SF, Huntflow, интранет, опросы сотрудников и пр.
*Офис* м. Шаболовская (скоро переезжаем на Зил)
*Условия* оклад 150-200 (выше обсуждается в зависимости от квалификации), премии, ДМС после испытательного срока, оплата питания и мобильной связи
Вопросы можно задавать мне здесь или на почту <mailto:irina.zhilina@leroymerlin.ru|irina.zhilina@leroymerlin.ru>
Я business product owner на данном направлении.
